import React from 'react';

const SkillsCertifications = () => {
  return (
    <div className="skills-certifications">
      <h2>Skills & Certifications</h2>
      <p>
        - Microsoft Office Specialist certified in Excel Expert 2016.
        - Adept in Python, PHP, SQL, Bootstrap, CSS, Javascript, Vue.js, Python Flask, Docker, and HTML.
        - Fluent in English and Mandarin.
        - Experience in using data visualization tools such as Tableau and Power BI.
        - Competent Communicator Award by Toastmasters International.
        - Competent Leader Award by Toastmasters International.
        - AI100: Python Programming and Data Visualization by Heicoders.
        - AI200: Applied Machine Learning by Heicoders.
        - Academy Introduction to Python Programming by Hackwagon Academy.
        - edX Verified Certificate for Python Basics for Data Science.
        - edX Verified Certificate for US-China Relations: Past, Present, and Future.
      </p>
    </div>
  );
};

export default SkillsCertifications;
